import './App.css';
import React,{useState,useEffect} from 'react';
import GrassGrid from './GrassGrid/GrassGrid';
import HandleMovement from './Movement/HandleMovement';

function App() {

  const [setMovementString, MovementString] = useState('Stop')

  window.addEventListener('keydown', (event) => {
    switch (event.key){
        case 'ArrowUp': setMovementString('Up'); break;
        case 'ArrowDown': setMovementString('Down'); break;
        case 'ArrowLeft': setMovementString('Left'); break;
        case 'ArrowRight': setMovementString('Right'); break;
    }
  })


  return (
    <div>
      <div className="App">
        <header className="App-header">
            <GrassGrid></GrassGrid>
        </header>
      </div>
    </div>
  );
}

export default App;
